import React from "react";
import "./app.css";
import TextEditor from "./TextEditor/TextEditor.js";

class App extends React.Component {
  render() {
    return (
      <div>
        <h3>Calendar goes here</h3>
        <h3>Weather Forecast goes here</h3>
        <TextEditor />
        <h3>Yelp listing goes here</h3>
      </div>
    );
  }
}

export default App;
